using Microsoft.EntityFrameworkCore;
using SGED.Objects.Models.Entities;

namespace SGED.Context.Builders
{
    public class UsuarioBuilder
    {
        public static void Build(ModelBuilder modelBuilder)
        {
            // Builder
            modelBuilder.Entity<UsuarioModel>().Property(u => u.Id);
            modelBuilder.Entity<UsuarioModel>().Property(u => u.ImagemPessoa).IsRequired();
            modelBuilder.Entity<UsuarioModel>().Property(u => u.NomePessoa).HasMaxLength(70).IsRequired();
            modelBuilder.Entity<UsuarioModel>().Property(u => u.EmailPessoa).IsRequired();
            modelBuilder.Entity<UsuarioModel>().Property(u => u.SenhaUsuario).HasMaxLength(64).IsRequired();
            modelBuilder.Entity<UsuarioModel>().Property(u => u.TelefonePessoa).HasMaxLength(15).IsRequired();
            modelBuilder.Entity<UsuarioModel>().Property(u => u.CpfCnpjPessoa).HasMaxLength(18).IsRequired();
            modelBuilder.Entity<UsuarioModel>().Property(u => u.RgIePessoa).HasMaxLength(15).IsRequired();
            modelBuilder.Entity<UsuarioModel>().Property(u => u.CargoUsuario).HasMaxLength(50).IsRequired();
            modelBuilder.Entity<UsuarioModel>().Property(u => u.StatusUsuario).IsRequired();
            modelBuilder.Entity<UsuarioModel>().Property(u => u.StatusUsuario).IsRequired();
            modelBuilder.Entity<UsuarioModel>().Property(u => u.IdTipoUsuario).IsRequired();

            // Declaração: Defini o ID como Chave Primária
            modelBuilder.Entity<UsuarioModel>().HasKey(u => u.Id);

            // Relacionamento: TipoUsuario -> Usuario
            modelBuilder.Entity<UsuarioModel>()
                .HasOne(u => u.TipoUsuario)
                .WithMany(tu => tu.Usuarios)
                .HasForeignKey(u => u.IdTipoUsuario)
                .OnDelete(DeleteBehavior.Cascade);


            // Inserções
            modelBuilder.Entity<UsuarioModel>().HasData(
                new UsuarioModel { Id = 1, NomePessoa = "SGED", EmailPessoa = "sged@development.com", SenhaUsuario = "8d969eef6ecad3c29a3a629280e686cf0c3f5d5a86aff3ca12020c923adc6c92", TelefonePessoa = "(00) 00000-0000", CpfCnpjPessoa = "000.000.000-00", RgIePessoa = "00.000.000-0", CargoUsuario = "Desenvolvimento", StatusUsuario = true, IdTipoUsuario = 1, ImagemPessoa = "data:image/png;base64," },
                new UsuarioModel { Id = 2, NomePessoa = "Secretário Geral", EmailPessoa = "admin@gmail.com", SenhaUsuario = "2a8610aefdd0028c6bf074dd18721c0ef8bc43241cc7a653d7aedf2036bdf6b3", TelefonePessoa = "(00) 00000-0000", CpfCnpjPessoa = "000.000.000-00", RgIePessoa = "00.000.000-0", CargoUsuario = "Secretário Geral", StatusUsuario = true, IdTipoUsuario = 2, ImagemPessoa = "" }
            );
        }
    }

}
